import { Button, Pagination, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import '../CSS/keywordCheckTable.css'
import { DataGrid,GridCellParams,GridColDef } from '@mui/x-data-grid';
import { KeywordJobStatusMap } from '../constants/KeywordRegistStatusList';
import { useState } from 'react';

export interface DataItem{
    createdAt: Date,
    mediaName: string,
    type: string,
    name: string,
    status: string,
    startAt:Date,
    endAt:Date,
    fileName:string,
    createdBy:string,
    [key: string]: any;
}

interface KeywordCheckTableProps {
    data: DataItem[];
  }
export default function KeywordCheckTable({ data }: KeywordCheckTableProps){

      const columns: GridColDef[] = [
        { 
            field: 'createdAt', headerName: '신청일', width: 100,headerAlign: 'center',
            valueGetter: (params) => {
                const { createdAt } = params.row;
                const date = createdAt.split(' ')[0];
                const time = createdAt.split(' ')[1];
                return `${date}<br />${time}`;
              },
              renderCell: (params) => (
                <div dangerouslySetInnerHTML={{ __html: params.value }} />
              ),
            },
        { field: 'mediaName', headerName: '광고상품', width: 150 },
        { field: 'type', headerName: '작업구분', width: 100},
        { field: 'name', headerName: '작업명', width: 150 },
        { field: 'status', headerName: '작업상태', width: 100,renderCell: (params: GridCellParams) => {
            const statusText = params.value?.toString() || '';
            const statusColor = KeywordJobStatusMap[statusText]?.color || '';
            const text = KeywordJobStatusMap[statusText]?.text || '';
            return (
              <div
                style={{
                  color: statusColor,
                  width: 'fit-content',
                  fontWeight : 'bolder',
                }}
              >
                {text}
              </div>
            );
          },},
        {
            field: 'startAt', headerName: '수행시작', width: 110 ,           
            valueGetter: (params) => {
                const { createdAt } = params.row;
                const date = createdAt.split(' ')[0];
                const time = createdAt.split(' ')[1];
                return `${date}<br />${time}`;
            },
            renderCell: (params) => (
                <div dangerouslySetInnerHTML={{ __html: params.value }} />
            ),
        },
        { 
            field: 'endAt', headerName: '수행종료', width: 110,
            valueGetter: (params) => {
                const { createdAt } = params.row;
                const date = createdAt.split(' ')[0];
                const time = createdAt.split(' ')[1];
                return `${date}<br />${time}`;
            },
            renderCell: (params) => (
                <div dangerouslySetInnerHTML={{ __html: params.value }} />
            ),},
        {
            field: 'registfile',
            headerName: '등록파일',
            width: 100,
            renderCell: (params: GridCellParams) => (
              <Button variant="outlined" color="error">
                다운로드
              </Button>
            ),
            headerAlign: 'center'
          },
          {
            field: 'fileresult',
            headerName: '결과',
            width: 100,
            renderCell: (params: GridCellParams) => {
                const { row } = params;
                console.log(row);
                if (row.status === 'S' || row.status === 'P') {
                  return (
                    <Button variant="outlined" color="error">
                      다운로드
                    </Button>
                  );
                } else {
                  return (
                    <Button variant="contained" disabled>
                      다운로드
                    </Button>
                  );
                }
              },
            headerAlign: 'center'
          },
          {
            field: 'waitcancel',
            headerName: '대기취소',
            width: 100,
            renderCell: (params: GridCellParams) => (
              <Button variant="contained" disabled>
                취소
              </Button>
            ),
          },
        { field: 'createdBy', headerName: '요청자', width: 220,headerAlign: 'center'},
      ];
      const pageSize = 5;
      const [currentPage, setCurrentPage] = useState(1);
      const totalPages = Math.ceil(data.length / pageSize);
      const startIndex = (currentPage - 1) * pageSize;
      const endIndex = startIndex + pageSize;
      const pageData = data.map((item, index) => ({ ...item, id: index })).slice(startIndex,endIndex);
      const handlePageChange = (event: React.ChangeEvent<unknown>, page: number) => {
        setCurrentPage(page);
      };

    return(
        <>
            {/* <div style={{ height: 600, width: '93%',marginLeft:'45px'}}>
                <DataGrid
                    // rows={data.map((item, index) => ({ ...item, id: index }))}
                    rows = {pageData}
                    columns={columns}
                    // initialState={{
                    //         pagination: {
                    //         paginationModel: { page: 0, pageSize: 5},
                    //         },}}

                    autoHeight
                    sx={{
                        m:1,
                        boxShadow: 2,
                        border: 1,
                        borderColor: 'primary.light',
                        '& .MuiDataGrid-cell:hover': {
                        color: 'primary.main',
                        },
                        fontSize: 13,
                    }}
                    disableColumnMenu
                />
                <Pagination
                    count={totalPages}
                    page={currentPage}
                    onChange={handlePageChange}
                    color="primary"
                /> */}
            {/* </div> */}

            {/*--------*/}
            <TableContainer component={Paper} style={{ maxWidth: '96%', marginLeft:'30px' }}>
      <Table sx={{ minWidth: 650 }} aria-label="caption table">
        <caption></caption>
        <TableHead>
          <TableRow>
            <TableCell align="center" sx={{ minWidth: '90px' }}>신청일</TableCell>
            <TableCell align="center" sx={{ minWidth: '110px' }}>광고상품</TableCell>
            <TableCell align="center" sx={{ minWidth: '60px' }}>작업구분</TableCell>
            <TableCell align="center">작업명</TableCell>
            <TableCell align="center">작업상태</TableCell>
            <TableCell align="center">수행시작</TableCell>
            <TableCell align="center">수행종료</TableCell>
            <TableCell align="center">등록파일</TableCell>
            <TableCell align="center">결과</TableCell>
            <TableCell align="center">대기취소</TableCell>
            <TableCell align="center">요청자</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {pageData.map((row) => (
            <TableRow key={row.id}>
              <TableCell component="th" scope="row" sx={{ fontSize: '13.5px' }}>
              {(() => {
                    const date = row.createdAt.toLocaleString().split(' ')[0];
                    const time = row.createdAt.toLocaleString().split(' ')[1];
                    return (
                        <div>
                            {date}<br />{time}
                        </div>
                    );
                })()}
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>{row.mediaName}</TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>{row.type}</TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>{row.name}</TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>
              {
                (() => {
                const statusText = row.status?.toString() || '';
                const statusColor = KeywordJobStatusMap[statusText]?.color || '';
                const text = KeywordJobStatusMap[statusText]?.text || '';
                return (
                    <div
                    style={{
                        color: statusColor,
                        width: 'fit-content',
                        fontWeight: 'bolder',
                    }}
                    dangerouslySetInnerHTML={{ __html: text }}
                    />
                );
                })()
            }
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>
                {/* startAt 변환 및 출력 */}
                <div dangerouslySetInnerHTML={{ __html: row.startAt }} />
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>
                {/* endAt 변환 및 출력 */}
                <div dangerouslySetInnerHTML={{ __html: row.endAt }} />
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>
                <Button variant="outlined" color="error">
                  다운로드
                </Button>
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>
                {row.status === 'S' || row.status === 'P' ? (
                  <Button variant="outlined" color="error" >
                    다운로드
                  </Button>
                ) : (
                  <Button variant="contained" disabled >
                    다운로드
                  </Button>
                )}
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>
                <Button variant="contained" disabled>
                  취소
                </Button>
              </TableCell>
              <TableCell align="center" sx={{ fontSize: '13.5px' }}>{row.createdBy}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
            <Pagination
                    count={totalPages}
                    page={currentPage}
                    onChange={handlePageChange}
                    color="primary"
            /> 
             </TableContainer>   
      </>
    );
}
